import { Link } from 'react-router-dom';
import './styles/Menu.css'; 
import { usePlayer } from './PlayerContext'; // Import the custom hook

const Menu = () => {

    return (
        <div className="menu">
        <Link to="/play" className="menu-link">
            Play
        </Link>
        <Link to="/leaderboard" className="menu-link">
            Leaderboard
        </Link>
        <Link to="/settings" className="menu-link">
            Settings
        </Link>
        </div>
    );
}

export default Menu;
